import './Slider.css';

const SliderAds = () =>{
    return (
        <div className="slider__ads">
                <header>
                    <h1>Rabat 10% na pierwsze zamówienie</h1>
                </header>
                <div>
                    <p>Do 20 stycznia złóż zamówienie na stronie i skorzystaj z promocji -10%. Spiesz się, czas trwania promocji do końca lutego.</p>
                </div>
                <button>Zamów online</button>

        </div>
    )

}

export default SliderAds;
